-- ----------------------------
-- Function structure for `nextval`
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`skip-grants user`@`skip-grants host` FUNCTION `nextval`( name varchar(50)) RETURNS int(11)
BEGIN
	declare _cur int;
	declare _maxvalue int;
	declare _increment int;
	set _increment = 1;
	set _maxvalue = 999999999;
	set _cur = (select CURRENT_VAL from SEQUENCE where SEQ_NAME = name);
	update SEQUENCE set CURRENT_VAL = _cur + _increment where SEQ_NAME = name;
	if(_cur + _increment >= _maxvalue) then
    	update SEQUENCE set CURRENT_VAL = MINVALUE where SEQ_NAME = name;
	end if;
	return _cur;
END
;;
DELIMITER ;
